def gameOfLife(grid: list[list[int]], k: int) -> list[list[int]]:
    dx = [1, 0, -1, 1, -1, -1, 1, 1]
    dy = [-1, 1, 0, 0, -1, 1, -1, 1]

    def check(r, c):
        live = 0
        power = 0
        for i in range(8):
            (nr, nc) = (r + dx[i], c + dy[i])
            if nr < 0 or nr >= len(grid) or nc < 0 or (nc >= len(grid[0])):
                continue
            if grid[nr][nc] == 1:
                live += 1
            elif grid[nr][nc] == 2:
                power += 1
        return (live, power)
    for _ in range(k):
        temp_grid = [[0 for _ in range(len(grid[0]))] for _ in range(len(grid))]
        for i in range(len(grid)):
            for j in range(len(grid[0])):
                if grid[i][j] == -1:
                    temp_grid[i][j] = -1
                    continue
                (live, power) = check(i, j)
                if grid[i][j] == 0 or grid[i][j] == 2:
                    if live == 3:
                        temp_grid[i][j] = 1
                    elif power:
                        temp_grid[i][j] = 1
                    elif grid[i][j] == 2:
                        temp_grid[i][j] = 2
                elif live < 2 or live > 3:
                    temp_grid[i][j] = 0
                else:
                    temp_grid[i][j] = 1
        grid = temp_grid
    return grid

